import { EMPTY, Observable, of } from 'rxjs';
import { Store } from './store';

/**
 * 
 * Helper function for checking if we have data in cache
 * 
 * export class ProductsService {
 *   constructor(private productsStore: ProductsStore) {}

 *   get(): Observable<void> {
 *     const request = this.http.get().pipe(
 *       tap(this.productsStore.set(response))
 *     );
 *
 *     return cacheable(this.productsStore, request);
 *   }
 * }
 */
export function cacheable<T>(store: Store, request$: Observable<T>, options: { emitNext: boolean } = { emitNext: false }): Observable<T | undefined | never> {
  if (store._cache().value) {
    return options.emitNext ? of(undefined) : EMPTY;
  }
  return request$;
}

import { combineLatest, Observable, ObservableInput, ObservedValueOf } from 'rxjs';
import { auditTime } from 'rxjs/operators';

type ReturnTypes<T extends Observable<any>[]> = { [P in keyof T]: T[P] extends Observable<infer R> ? R : never };
type Observables = [Observable<any>] | Observable<any>[];

export function combineQueries<R extends Observables>(observables: R): Observable<ReturnTypes<R>> {
  return combineLatest(observables).pipe(auditTime(0)) as any;
}

